// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

contract Agreement {
    address payable public partyA;
    address payable public partyB;
    uint public amount;
    bool public partyA_Approved;
    bool public partyB_Approved;

    constructor(address payable _partyA, address payable _partyB, uint _amount) {
        partyA = _partyA;
        partyB = _partyB;
        amount = _amount;
    }

    function approve() public payable {
        if (msg.sender == partyA){
            partyA_Approved = true;
        } else if (msg.sender == partyB){
            partyB_Approved = true;
        }
        if (partyA_Approved && partyB_Approved){
            pay();
        }
    }

    function pay() internal {
        partyA.transfer(amount);
    }
}

